import React, { Component } from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import { Link } from 'react-router-dom';

export default class ManageProvider extends Component {
  render() {
    return (
      <div className="home">
        <Header></Header>
        <section>
          <div className="jumbotron jumbotron-fluid py-5">
            <div className="container text-center py-5">
              <h1 className="display-4">Welcome to administrator account</h1>
              <p className="lead">You can manage Provider,Service and client.</p>
              <div className="mt-4">
                <Link className="btn btn-primary px-5 mr-3" to="/signup">Manage Provider</Link>
                <Link className="btn btn-primary px-5 mr-3" to="/Chat">Manage Client</Link>
                <Link className="btn btn-primary px-5 mr-3" to="/signup">Manage Service</Link>
                < br></ br>

              </div>
            </div>
          </div>
        </section>
        <Footer></Footer>
      </div>
    )
  }
}
